const HomePage = () => {
  return (
    <div className="post">
      <div className="header-section">Rick <BsThreeDots /> </div>
      <div className="img-section">
        <img
          src="https://www.nme.com/wp-content/uploads/2022/10/Rick_And_Morty_Portal_Gun_JuRicksic_Mort.jpg"
          alt="Post Img"
        />
      </div>
      <div className="like-comment-description-section">
        <div className="like-comment">
          <BsHeart />
          <BiCommentDetail />
        </div>
        <div className="like-counter">200 likes</div>
        <div className="post-description">
          <span className="post-id">rick</span>{" "}
          <span>
            Lorem ipsum dolor sit, amet consectetur adipisicing elit. Fugit
            eligendi quam tempore dicta minima, culpa, accusamus nam quis
            numquam asperiores
          </span>
        </div>
        <div className="comment-section">View all 10 comments</div>
      </div>
    </div>
  );
};

export default HomePage;
